import React, { Component } from 'react';
import './App.css';
import {BrowserRouter, Route, Switch} from 'react-router-dom'
import HomeForm from './main/main';
import AboutForm from './main/about';
import ResumeForm from './main/resume';
import ContactForm from './main/contact';

class App extends Component {


  render(){
  return (
    <BrowserRouter>

    <div className="App">

<Switch>
   <Route exact path="/home" component= {HomeForm} />
   <Route exact path="/about" component= {AboutForm} />
   <Route exact path="/resume" component= {ResumeForm} />
   <Route exact path="/contact" component= {ContactForm} />
</Switch>
        <div class="hero-container" data-aos="fade-in">
          <h1>Massaoud Jarray</h1>
          <p>I'm <span class="typed" data-typed-items=" Engineer, Developer, Freelancer"></span></p>
        </div>


</div>

    </BrowserRouter>


    );
}}

export default App;
